content:
Vừa nhận hàng kiểm tra EK3104 thì có một số điểm sau:
- Shop không gửi kèm keycap cờ sao vàng để thay thế cho nút ESC;
- Phím Shift bên phải không gõ được, nghi ngờ do hư Switch;
- Không kết nối được với chương trình điều khiển LED RGB của Edra (App tải trên web của EDRA)
Đã gọi trực tiếp phản ánh cho cửa hàng thì được hướng dẫn liên hệ qua kênh Chat ở Tiki. Gửi tin nhắn cho cửa hàng qua kênh Tiki thì không thấy trả lời. 
Rất không hài lòng vế cửa hàng và chất lượng sản phẩm.
